snippet.textDisplay:
@TapeLinked
China held strongest AND MOST super computers of any other country.
Just because we now have a single super computer than beats their strongest single super computer, does China still have more super computing power than the USA? How would scaling work for super computing? Is it pure quantity of processing power or will having overall more processing power, over multiple computers, be better?

